import React from 'react'
import TreeView from '@material-ui/lab/TreeView'
import TreeItem from '@material-ui/lab/TreeItem'
import { makeStyles } from '@material-ui/core/styles'
import '../../style/member/member_Navbarlist_o.scss'

const useStyles = makeStyles({
  root_nav: {
    display: 'flex',
    flex: 'row',
  },
  root_nav2: {
    display: 'flex',
    flex: 'row',
    width: 200,
  },
  root_nav3: {
    width: 100,
  },
})

export default function FileSystemNavigator() {
  const classes = useStyles()

  return (
    <TreeView className="row mem_navbarlist1">
      <TreeItem nodeId="1" label="購物車" className={classes.root_nav}>
        <div className={classes.root_nav2}>
          <TreeItem nodeId="2" label="活動" className={classes.root_nav3} />
          <TreeItem nodeId="3" label="課程" className={classes.root_nav3} />
        </div>
      </TreeItem>
      <TreeItem nodeId="5" label="未付款" className={classes.root_nav}>
        <TreeItem nodeId="10" label="活動" />
        <TreeItem nodeId="6" label="課程"></TreeItem>
      </TreeItem>
    </TreeView>
  )
}
